import React, { useEffect, useState } from "react"
import firebase from "../../firebase/firebase"

export const Excel = () => {
    const [profesionales, setProfesionales] = useState([])
    console.log(profesionales)
    useEffect(() => {
        firebase.db.collection("profesionales").onSnapshot(querySnapshot => {
            const profesionales = []
            querySnapshot.docs.forEach(doc => {
                const { name, id } = doc.data()
                profesionales.push({
                    id: doc.id,
                    name
                })
            })
            setProfesionales(profesionales)
        })
    }, [])
    return <div>
        <div className="container">
            <div className="row row-cols-2 ">
                {profesionales.map(item =>
                    <div className="row">
                        <div className="col mb-2 border">{item.name}</div>
                        <input className="col"></input>
                    </div>
                )}
            </div>
        </div>
    </div>
}
